class ArticleAdd extends React.Component {


  handleSubmit(event){
    alert(event.text)
  }

  tag_article(tag_name){
    alert(tag_name)
  }
  render() {
    const status = 'Enter Article URL';
    labelname1 = "Eats"
    labelname2 = "Tech"
    labelname3 = "Wow"

    return (
      <div>
      <h1>Noteable</h1>
      <div className="status">{status}</div>
      <form onSubmit={this.handleSubmit}>
      <input type="text"></input>
      <br></br>
      <input onClick = "tag_article({this.props.labelname})" type="button" value={labelname1}></input>
      <input onClick = "tag_article({this.props.labelname})" type = "button" value={labelname2}></input>
      <input onClick = "tag_article({this.props.labelname})" type = "button" value={labelname3}></input>
      <br></br>
      <input type="submit"></input>
      </form>
      </div>
    );
  }
}

class Home extends React.Component {
  render() {
    return (
      <div className="home">
      <ArticleAdd />
      <ArticleBox title="Local Fireman Saves Cat!" />
      <ArticleBox title="Recent Reveal of New Baby"  />
      <ArticleBox title="World Record Broken"  />
      </div>
    );
  }
}
